            <mtext>Hg</mtext>
            <mo stretchy="false">]</mo>
          </mrow>
          <mrow>
            <mo stretchy="false">[</mo>
            <msubsup>
              <mtext>Hg</mtext>
              <mrow class="MJX-TeXAtom-ORD">
                <mn>2</mn>
              </mrow>
              <mrow class="MJX-TeXAtom-ORD">
                <mn>2</mn>
                <mo>+</mo>
              </mrow>
            </msubsup>
            <mo stretchy="false">]</mo>
          </mrow>
        </mfrac>
